INSERT INTO `msberita` (`IDBerita`, `TglBerita`, `JudulBerita`, `IsiBerita`) VALUES
('000001', '2018-04-03', 'Pembukaan Bursa Kerja Disnaker Kota Depok', '<p>Bursa Kerja Dinas Tenaga Kerja Kota Depok telah dilaksanakan pada akhir bulan Maret 2018 dan telah berjalan dengan sukses</p>\n'),
('000002', '2018-04-04', 'Informasi Pasar Kerja', '<p><strong><a href="http://ouo.io/9dJH9">Link Info Kerja Naker</a></strong></p>\n\n<p><strong>INFORMASI PASAR KERJA</strong></p>\n\n<p><strong>Kementerian Ketenagakerjaan Republik Indonesia</strong></p>\n'),
('000006', '2018-04-19', 'Bursa Kerja Pemerintah Kota Depok & Kemenaker RI', '<p><strong>Bursa Kerja - Dinas Tenaga Kerja Kota Depok</strong></p>\n\n<p><strong>Tgl : 25 s.d 26 April 2018, di Cimanggis Square, Lobby, Lt. Dasar,</strong></p>\n\n<p><strong>Jl. Raya Bogor - Depok</strong></p>\n\n<p><strong>Link : </strong><a href="http://e-bursakerja.kemnaker.go.id/pendaftaran"><strong>Pendaftaran Bursa Kerja Kota Depok &amp; Kementerian Ketenagakerjaan RI</strong></a></p>\n'),
('000007', '2018-04-20', 'Lowongan Kemntrian Kordinator Bidang Perekonomian', '<p>Tenaga Pendukung Teknis Analis Pemanfaatan Ruang Bidang Kawasan Strategis Ekonomi<br />\nKode Posisi: G4-DVI-01<br />\nPersyaratan<br />\n&nbsp;</p>\n\n<ul>\n	<li>Pria atau Wanita dengan usia maksimal 35 tahun.</li>\n	<li>Lulusan minimal dengan Sarjana Teknik Perencanaan / Planologi Perkotaan dan Daerah.</li>\n	<li>Lulus dari akreditasi universitas terkemuka A (PTN / PTS) dengan IPK minimal 3,00.</li>\n	<li>Menguasai pengetahuan Microsoft Office dan mampu membuat grafik info.</li>\n	<li>Tidak bekerja / terikat kontrak dengan lembaga atau perusahaan lain.</li>\n	<li>Mampu bekerja sama dalam tim dengan baik dan mandiri secara efektif.</li>\n	<li>Memiliki NPWP dan BPJS Kesehatan (tanpa iuran yang terhutang) atau bersedia menjadi anggota BPJS dan membayar kontribusi BPJS Kesehatan jika lolos seleksi.</li>\n</ul>\n\n<p>Pengumuman lengkap bisa diliat link : <a href="https://ouo.io/waaQqc">Pengumuman Penerimaan Kementerian Koordinator Bidang Perekonomian</a></p>\n\n<p>Pendaftaran dilakukan secara online melalui : <a href="https://ouo.io/Ie37J2">rekrutmentp.go.id</a> paling lambat tgl 23 April 2018 pukul 17.00 wib. Diharapkan untuk seluruh peserta melampirkan scan KTP, Daftar riwayat hidup, ijazah, akreditasi program studi, dan transkip nilai. Hasil seleksi administrasi akan diumumkan melalui website : <a href="https://ouo.io/1X4axM">Pengumuman </a>Pada tanggal 24 April 2018</p>\n'),
('000008', '2018-04-20', 'Rekrutmen Pegawai Non-PNS LKPP', '<h3><strong>Pengumuman Rekrutmen Pegawai Non-PNS (Staf Pendukung) Pusat Pendidikan dan Pelatihan Pengadaan Barang/Jasa</strong></h3>\n\n<p>Staf Pendukung Analis Akreditasi Lembaga Diklat&nbsp; (Kode: AKLP)<br />\n&nbsp;</p>\n\n<ul>\n	<li>Pendidikan minimal S1 Jurusan Manajemen/ Statistik/Teknik;</li>\n	<li>Nilai Indeks Prestasi Kumulatif (IPK) minimal 3,00 dari skala 4,00;</li>\n	<li>Diutamakan memiliki nilai CAT sesuai dengan standar dalam Peraturan Kementrian Pendayagunaan Aparatur Negara dan Reformasi Birokrasi (PANRB);</li>\n	<li>Diutamakan memiliki pengalaman dibidang Akreditasi;</li>\n	<li>Tidak pernah terlibat narkoba dan pelanggaran hukum lainnya;</li>\n	<li>Memiliki pengalaman/ kemampuan pekerjaan yang bersifat analisis;</li>\n	<li>Memiliki kemampuan untuk melakukan pekerjaan administrasi;</li>\n	<li>Mampu berkomunikasi dengan baik dan kemauan untuk belajar;</li>\n	<li>Mampu bekerja mandiri maupun dalam tim, memiliki integritas dan motivasi kerja yang tinggi;</li>\n	<li>Memiliki ketelitian dan kerapian dalam bekerja;</li>\n	<li>Mampu menggunakan alat bantu seperti Microsoft Office/aplikasi lain yang mendukung;</li>\n	<li>Apabila pelamar memiliki pengalaman bekerja di LKPP, maka pelamar memiliki nilai SKP lebih dari 80;</li>\n</ul>\n\n<p><br />\n<br />\nStaf Pendukung Analis Kerjasama Diklat Kompetensi (Kode: AKDK)<br />\n&nbsp;</p>\n\n<ul>\n	<li>Pendidikan minimal S1 Jurusan Pendidikan/ Psikologi/ Ilmu Komunikasi/ Manajemen;</li>\n	<li>Nilai Indeks Prestasi Kumulatif (IPK) minimal 3,00 dari skala 4,00;</li>\n	<li>Diutamakan memiliki nilai CAT sesuai dengan standar dalam Peraturan Kementrian Pendayagunaan Aparatur Negara dan Reformasi Birokrasi (PANRB);</li>\n	<li>Diutamakan mempunyai pengalaman kerja di bidang Pendidikan, fasilitator kegiatan pelatihan atau di bidang customer service/call center&nbsp; minimal 1 tahun;</li>\n	<li>Tidak pernah terlibat narkoba dan pelanggaran hukum lainnya;</li>\n	<li>Memiliki Interpersonal skill yang baik, percaya diri dan bersedia tampil di depan umum;</li>\n	<li>Mampu berkomunikasi dengan baik dan kemauan untuk belajar;</li>\n	<li>Mampu bekerja mandiri maupun dalam tim, memiliki integritas dan motivasi kerja yang tinggi;</li>\n	<li>Mampu menggunakan alat bantu seperti Microsoft Office/aplikasi lain yang mendukung;</li>\n	<li>Apabila pelamar memiliki pengalaman bekerja di LKPP, maka pelamar memiliki nilai SKP lebih dari 80;</li>\n</ul>\n\n<p><br />\n<br />\nStaf<br />\n<br />\nPendukung Arsiparis Terampil (Kode: AT)<br />\n&nbsp;</p>\n\n<ul>\n	<li>Pendidikan minimal D3 Jurusan Kearsipan/ Administrasi/ Ilmu Perpustakaan;</li>\n	<li>Nilai Indeks Prestasi Kumulatif (IPK) minimal 3,00 dari skala 4,00;</li>\n	<li>Diutamakan memiliki nilai CAT sesuai dengan standar dalam Peraturan Kementrian Pendayagunaan Aparatur Negara dan Reformasi Birokrasi (PANRB);</li>\n	<li>Diutamakan memiliki pengalaman dibidang pengarsipan;</li>\n	<li>Tidak pernah terlibat narkoba dan pelanggaran hukum lainnya;</li>\n	<li>Memiliki kemampuan untuk melakukan pekerjaan administrasi;</li>\n	<li>Mampu berkomunikasi dengan baik dan kemauan untuk belajar;</li>\n	<li>Mampu bekerja mandiri maupun dalam tim, memiliki integritas dan motivasi kerja yang tinggi;</li>\n	<li>Memiliki ketelitian dan kerapian dalam bekerja;</li>\n	<li>Mampu menggunakan alat bantu seperti Microsoft Office/Adobe Creative Suite/aplikasi lain yang mendukung;</li>\n	<li>Apabila pelamar memiliki pengalaman bekerja di LKPP, maka pelamar memiliki nilai SKP lebih dari 80;</li>\n</ul>\n\n<p><strong>TATA CARA PENGIRIMAN BERKAS LAMARAN</strong></p>\n\n<ol>\n	<li>Dokumen lamaran terdiri dari:</li>\n</ol>\n\n<ol>\n	<li>Surat lamaran</li>\n	<li>Daftar Riwayat Hidup</li>\n	<li>Fotocopy Kartu Tanda Penduduk</li>\n	<li>Salinan ijazah yang telah dilegalisir oleh Pejabat yang berwenang</li>\n	<li>Salinan transkrip nilai yang telah dilegalisir oleh pejabat berwenang</li>\n	<li>Tanda bukti hasil tes CAT</li>\n	<li>Foto 3x4 (1 buah dan bewarna)</li>\n	<li>Portofolio yang mendukung kepemilikan kompetensi</li>\n	<li>Sertifikat-sertifikat yang mendukung kompetensi</li>\n	<li>Surat keterangan bebas narkoba dari instansi terkait&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2. Dokumen lamaran dikirim dalam bentuk <em>softcopy </em>dalam satu folder<strong> discan dengan format:</strong></li>\n</ol>\n\n<p><strong>Subject email: Rekrutmen</strong><strong> (KODE)</strong><strong> Pusdiklat LKPP 2018</strong></p>\n\n<p><strong>Melalui email ke</strong> <strong>rekrutmen.pusdiklatlkpp2018@gmail.com</strong></p>\n\n<ol>\n	<li>Pelamar mengisi <strong>google form</strong> yang terdapat di portal pengumuman, dengan alamat : <a href="https://ouo.io/lJe26">Form Pendaftaran</a></li>\n	<li>Dalam surat lamaran diterterakan <strong>KODE</strong> jabatan yang dilamar:</li>\n</ol>\n\n<ul>\n	<li><strong>AKLP&nbsp; : Staf Analis Akreditasi Lembaga Diklat</strong>&nbsp;</li>\n	<li><strong>AKDK :</strong> <strong>Staf Analisis Kerjasama Diklat Kompetensi</strong></li>\n	<li><strong>AT&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; : Staf Arsiparis Terampil</strong></li>\n</ul>\n\n<ol>\n	<li>Pengiriman berkas lamaran diterima <strong>paling lambat tanggal </strong><strong>25</strong> <strong>April</strong><strong> 2018</strong></li>\n	<li>Setiap lamaran yang masuk akan segera diproses untuk seleksi administrasi</li>\n	<li>Pelamar yang lulus seleksi administrasi akan mendapatkan konfirmasi untuk mengikuti seleksi ke tahap selanjutnya. Apabila tidak lulus seleksi adminstrasi, pelamar&nbsp; tidak akan mendapatkan konfirmasi lanjutan dan dapat dinyatakan gugur karena tidak sesuai kualifikasi.</li>\n</ol>\n\n<p>&nbsp;</p>\n'),
('000004', '2018-04-12', 'Lowongan di PT Sucofindo', '<p>PT. SUCOFINDO (PERSERO) membuka lowongan pekerjaan untuk posisi :<br />\n<strong>Sekretaris 2-Bagian Perencanaan </strong>dengan persyaratan sbb :</p>\n\n<ul>\n	<li>Pendidikan Diploma III -Ilmu Administrasi.</li>\n	<li>Berkewarganegaraan Indonesia (WNI).</li>\n	<li>IPK minimal 3,00 dari skala 4.00</li>\n	<li>Berpengalaman kerja minimal 1 tahun.</li>\n	<li>Memiliki kemampuan Diutamakan memiliki pengalaman sebagai sekretaris Usia maks. 30 Tahun Mampu berbahasa Inggris baik l.</li>\n	<li>Umur maksimal 27 tahun pada saat mengajukan surat lamaran.</li>\n	<li>Belum menikah.</li>\n	<li>Bersedia ditempatkan dan ditugaskan di seluruh wilayah kerja PT SUCOFINDO (PERSERO)</li>\n	<li>Tidak pernah diberhentikan tidak dengan hormat sebagai pegawai suatu instansi pemerintah ataupun swasta</li>\n	<li>Tidak mempunyai hubungan keluarga dengan pegawai perusahaan sebagai suami-isteri, kakak adik kandung (tiri/angkat), orang tua/anak kandung (tiri/angkat)</li>\n	<li>Hanya yang memenuhi syarat yang akan dipanggil untuk mengikuti seleksi di Kantor Pusat - Jakarta</li>\n</ul>\n\n<p>Pendaftaran Melalui : <a href="http://ceesty.com/wI9RON">FORM LAMARAN </a></p>\n'),
('000005', '2018-04-12', 'Lowongan PT. SUCOFINDO Development Specialist 1-Ba', '<p>PT. SUCOFINDO (PERSERO) membuka lowongan pekerjaan untuk posisi :<br />\n<strong>Development Specialist 1-Bagian Pengembangan Jasa (SBU Hulu Migas dan Produk Migas) </strong>dengan persyaratan sbb :</p>\n\n<ul>\n	<li>Pendidikan S1 -Semua Jurusan.</li>\n	<li>Berkewarganegaraan Indonesia (WNI).</li>\n	<li>IPK minimal 3,00 dari skala 4.00</li>\n	<li>Berpengalaman kerja minimal 2 tahun.</li>\n	<li>Memiliki kemampuan mengidentifikasi penyempurnakan pelaksanaan pengembangan jasa tersebut dan menjembatani komunikasi a.</li>\n	<li>Umur maksimal 27 tahun pada saat mengajukan surat lamaran.</li>\n	<li>Belum menikah.</li>\n	<li>Bersedia ditempatkan dan ditugaskan di seluruh wilayah kerja PT SUCOFINDO (PERSERO)</li>\n	<li>Tidak pernah diberhentikan tidak dengan hormat sebagai pegawai suatu instansi pemerintah ataupun swasta</li>\n	<li>Tidak mempunyai hubungan keluarga dengan pegawai perusahaan sebagai suami-isteri, kakak adik kandung (tiri/angkat), orang tua/anak kandung (tiri/angkat)</li>\n	<li>Hanya yang memenuhi syarat yang akan dipanggil untuk mengikuti seleksi di Kantor Pusat - Jakarta</li>\n</ul>\n\n<p>Pendaftaran Melalui <a href="http://ceesty.com/wO0r05">FORM LAMARAN</a></p>\n'),
('000009', '2018-08-27', 'Lowongan PKWT di Divisi HUKUM & ASET PTPN XI', '<p>Karyawan PKWT di Divisi HUKUM & ASET<br />\nPersyaratan<br />\n&nbsp;</p>\n\n<ul>\n	<li>Pria usia maksimal 28 tahun.</li>\n	<li>Pendidikan S1 Hukum</li>\n	<li>IPK minimal 3,00.</li>\n	<li>Mampu berbahasa inggris tulis/lisan dan mengoperasikan Ms Office</li>\n	<li>Pengalaman/Pernah Magang/Pernah bekerja di Kantor Konsultan Hukum</li>\n	<li>Memahami legal knowledge drafting skill</li>\n	<li>Telah lulus Pendidikan Khusus Profesi Advokat (PKPA)</li>\n<li> Memiliki ijin beracara merupakan nilai tambah</li>\n<li> Bersedia ditempatkan di Unit Kerja sesuai kebutuhan Perusahaan</li>\n</ul>\n\n<p> Kelengkapan Data </p>\n\n<ul>\n<li>Surat Lamaran dan Daftar Riawayat Hidup</li>\n<li>Pas Foto berwarna ukuran 4x6 (2 lembar)</li>\n<li>Fotokopi Ijazah dan Transkrip Nilai legalisir</li>\n<li>Copy SKCK yang masih berlaku</li>\n<li>Fotokopi KTP & KK yang masih berlaku</li>\n<li>Surat pengalaman kerja (jika ada)</li>\n</ul>\n\n\n<p> Catatan </p>\n\n<ul>\n<li>Pendaftaran paling lambat 31 Agustus 2018</li>\n<li>Proses rekrutmen TIDAK DIPUNGUT BIAYA APAPUN</li>\n<li>PT PTPNXI tidak pernah bekerjasama dengan agen travel manapun dalam proses rekrutmen</li>\n<li>Hanya pelamar yang sesuai kualifikasi yang akan diproses mengikti seleksi</li>\n<li>Seluruh berkas untuk dikirimkan dalam amplop tertutup kepada:</li>\n<li> - DIVISI SDM & UMUM PTPN XI</li>\n<li> - Jl. Merak No.1 Surabaya</li>\n<li> - Telpon: 031-3524596 Ext: 248</li>\n</ul>\n\n<p>Sumber : <a href="http://ptpn11.co.id/berita/kesempatan-berkarir">PTPN XI</a></p>\n\n'),
('000011', '2018-08-30', 'Rekrutmen Umum PLN Group', '<p>Pengumuman Rekrutmen Umum PLN Group Tingkat S1, D-IV dan D-III Tahun 2018  Lokasi Bandung<br />\n&nbsp;</p>\n\n<ul>\n	<li>1. Pendaftaran dibuka mulai tanggal 27 – 31 Agustus 2018 </li>\n	<li>2. Lokasi Tes : Bandung </li>\n        <li>3. Keterangan Lebih Lanjut bisa dilihat pada pendaftaran online</li>\n</ul>\n\n\n<p>Pendaftaran Online dapat dilakukan melalui aplikasi : <a href="https://rekrutmen.pln.co.id/">Rekrutmen Pln</a></p>');
INSERT INTO `msberita` (`IDBerita`, `TglBerita`, `JudulBerita`, `IsiBerita`) VALUES
('000012', '2018-09-19', 'Pengumuman CPNS Pemerintah Prov Jabar', '<p style="margin-bottom: 0px; line-height: 25px; font-family: " open="" sans";="" font-size:="" 15px;="" text-align:="" center;"="">Sesuai Keputusan Menteri Pendayagunaan Aparatur Negara dan Reformasi Birokrasi Nmor 234 Tahun 2018 tanggal 30 Agustus Tahun 2018 tentang&nbsp;Kebutuhan&nbsp;pegawai Aparatur Sipil Negara di Lingkungan Provinsi Jawa Barat Tahun Anggaran 2018, Pemerintah Daerah Provinsi Jawa Barat akan membuka kesempatan kepada warga/masyarkat yang berminat dan memenuhi syarat untuk menjadi Pegawai Negeri Sipil di Lingkungan Pemerintah Provinsi Jawa Barat melalui pendaftaran online melalui portal Sistem Seleksi CPNS Nasional (SSCN) Badan Kepegawaian Negara (BKN).</p><p style="margin-bottom: 0px; line-height: 25px; font-family: " open="" sans";="" font-size:="" 15px;"="">Terdapat&nbsp;1.085 formasi dengan rincian :</p><p style="margin-bottom: 0px; line-height: 25px; font-family: " open="" sans";="" font-size:="" 15px;"="">a. Formasi Khusus Eks tenaga Honorer - K II Tenaga Guru sebanyak 1 (satu) Formasi.</p><p style="margin-bottom: 0px; line-height: 25px; font-family: " open="" sans";="" font-size:="" 15px;"="">b. Formasi Khusus Lulusan Terbaik Predikat Camlaude sebanyak&nbsp;28 (dua puluh delapan) Formasi</p><p style="margin-bottom: 0px; line-height: 25px; font-family: " open="" sans";="" font-size:="" 15px;"="">c.&nbsp;Formasi Disabilitas&nbsp;sebanyak 11 (sebelas) Formasi</p><p style="margin-bottom: 0px; line-height: 25px; font-family: " open="" sans";="" font-size:="" 15px;"="">d. Formasi UMUM sebanyak 1.045&nbsp;Formasi&nbsp;</p><p style="margin-bottom: 0px; line-height: 25px; font-family: " open="" sans";="" font-size:="" 15px;"="">&nbsp;</p><p style="margin-bottom: 0px; line-height: 25px; font-family: " open="" sans";="" font-size:="" 15px;"="">Pendaftaran peserta seleksi CPNS 2018 dilakukan serentak secara online oleh panitia Seleksi Nasional dan dapat dibuka melalui&nbsp;portal&nbsp;<span style="font-weight: 700;"><a href="https://sscn.bkn.go.id/" style="color: rgb(51, 122, 183); transition: all 0.3s ease-out 0s; outline: none;">https://sscn.bkn.go.id/</a>&nbsp;</span></p><p style="margin-bottom: 0px; line-height: 25px; font-family: " open="" sans";="" font-size:="" 15px;"="">Calon pelamar hanya dapat mendaftar pada 1 (satu) Instansi Pemerintahan dan 1 (satu) formasi jabatan.</p><p style="margin-bottom: 0px; line-height: 25px; font-family: " open="" sans";="" font-size:="" 15px;"=""><a href="http://bkd.jabarprov.go.id/berita/111-pengumuman-pelaksanaan-seleksi-cpns-pemerintah-provinsi-jawa-barat-tahun-2018" target="_blank">Link Pengumuman CPNS Prov Jabar</a><br></p><p style="margin-bottom: 0px; line-height: 25px; font-family: " open="" sans";="" font-size:="" 15px;"="">Hati - Hati terhadapa segala bentuk Penipuan terkait CPNS 2018<br><br>Informasi lebih lanjut / ikuti website BKD atau dapat menghubungi BKD Provinsi Jawa Barat.</p><p style="margin-bottom: 0px; line-height: 25px; font-family: " open="" sans";="" font-size:="" 15px;"=""><img src="data:image/jpeg;base64," data-filename="PENGUMUMAN_SELEKSI_CPNS_2018.jpg" style="width: 774px;"><br></p>');
